import React, { useState } from "react";
import './Login.scss'
import {Link} from 'react-router-dom';
import huellita from '../../assets/images/huellita.png'

function Login(){

    const[emailval, setemailval]= useState("");
    const[passval, setpassval]=useState("");

    const handleSubmit=(event)=>{
        event.preventDefault();
    }

    return(
        <div className="main-login">
            <Link to="/Registro">Registro</Link>
                <div className="login-container">
                      <div className = "left-side">
                        <div className="img-class">
                            <img src={huellita} id="img-id" alt="" srcset=""/>
                        </div>
                            <form onSubmit={handleSubmit}>
                            <label for="email1">Correo</label>    
                                <input className="input" placeholder="Ingresa tu correo" type="email" value={emailval}
                                onChange={(e)=>{setemailval(e.target.value)}} id="email1"/>
                            <label for="pwd1">Contraseña</label>    
                                <input className="input" placeholder="Ingresa tu contraseña" type="password" 
                                value={passval} onChange={(e)=>{setepassval(e.target.value)}} id="pwd1"/>
                                <button type= "submit" id="sub_butt">Iniciar sesión</button>
                            </form>

                            <div className="footer">
                                <h4>No eres administrador,  <Link to="/Registro">envía una solicitud</Link></h4>
                            </div>
                        </div>
                        
                        <div className="right-side">
                            
                        </div>
                     
                </div>
            
        </div>
    )
}

export default Login;
